import { IRouteItem } from 'app/shared/model';

export const Login = '/login';
export const Home = '/home';
export const Assisants = '/assisants';
export const Agents = '/agents';
export const Logout = '/logout';
export const AccountInfo = '/account/info';
export const AccountForgotPassword = '/account/forgot-password';
export const AccountVerifyEmail = '/account/verify-email';
export const Register = '/register';
export const AccountNewPassword = '/account/new-password';
export const agentPlatformRoute = {
  Login,
  Logout,
  Register,
  Home,
  Assisants,
  Agents,
  AccountInfo,
  AccountForgotPassword,
  AccountVerifyEmail,
  AccountNewPassword
};

export const agentPlatformRouteItem: IRouteItem[] = [
  { path: Home, icon: 'home', label: 'sideBar.home' }
  // { path: AccountInfo, icon: 'user', label: 'sideBar.account' },
  // { path: Teams, icon: 'users', label: 'sideBar.manageTeam' },
  // { path: Assisants, icon: 'briefcase', label: 'sideBar.assistant' }
];
